control.onUpdate:
if(text.length > 0){
    if (text == '1new') {
        text = '待分配';
        ee.setText(sender, text);
        return;
    }

    if (text == '2met') {
        text = '已分配';
        ee.setText(sender, text);
        return;
    }

    if (text == '3prc') {
        text = '进行中';
        ee.setText(sender, text);
        return;
    }
}else{
    text = ''; 
    ee.setText(sender,text);
}

