taskSetItem.script2:
var taskId = eio.readInt32(); //订单ID
var status = eio.readString16(); //订单状态

var sql, sqlResult;
/*sql  = "select id as c from userInfo where userType = '教练' and  mobile= '" + coachMobile + "'";
es.logWarning(sql);
sqlResult = db.executeQuery("PJ", sql);
db.read(sqlResult);
var coachId = db.getString(sqlResult, "c");
es.logWarning(coachId);
*/
if (status == "待分配") {
    sql = "exec task1Remove " + taskId ;
    sqlResult = db.executeQuery("PJ", sql);
    if (!db.read(sqlResult)) {
    eio.appendString16("F");
    eio.appendString16("系统繁忙，请稍后再试");
    return;
    }
    if (db.getInt32(sqlResult, "errorCode") != 0) {
    eio.appendString8("F");
    eio.appendString8(db.getString(sqlResult, "errorString"));
    return;
    }
    eio.appendString8("T")
} else if (status == "已分配") {
    sql = "exec task2Remove " + taskId ;
    sqlResult = db.executeQuery("PJ", sql);
    if (!db.read(sqlResult)) {
    eio.appendString16("F");
    eio.appendString16("系统繁忙，请稍后再试");
    return;
    }
    if (db.getInt32(sqlResult, "errorCode") != 0) {
    eio.appendString8("F");
    eio.appendString8(db.getString(sqlResult, "errorString"));
    return;
    }
    eio.appendString8("T")
}

